import logo from './logo.svg';
import img from './img/whale.png';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={img} className="App-logo" alt="logo" />
        <div>
          <input type="text" className="App-input" placeholder='테스트임둥' maxLength={10}></input>  
        </div>
        <p>리액트 테스트</p>
        <p>
          c조는 <code>위대한</code> 조다
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          하지만 서영정은 멍청하다.
        </a>
      </header>
    </div>
  );
}
